import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginFormPage from './pages/loginFormPage';
import 'react-toastify/dist/ReactToastify.css';
import Db from './pages/dbPage';
import { ProtectedRoute, PublicRoute } from './utils/ProtectedRoute';
import EmployeeDashboard from './components/DashBoards/EmployeeDashboard';
import InternDashboard from './components/DashBoards/InternDashboard';
import AppDevDashboard from './components/DashBoards/AppDevDashboard';
import WebDevDashboard from './components/DashBoards/';
function App() {
  return (
    <Router>
      
    <Routes>
    
      <Route path="/" element={<PublicRoute element={LoginFormPage} />} />
      <Route path="/login" element={<PublicRoute element={LoginFormPage} />} />
      <Route path="/db" element={<ProtectedRoute element={Db} />} />
      <Route path="/employee" element={<EmployeeDashboard />} />
        <Route path="/intern" element={<InternDashboard />} />
        <Route path="/app-dev" element={<AppDevDashboard />} />
        <Route path="/web-dev" element={<WebDevDashboard />} />
    </Routes>
  </Router>
  );
}

export default App;
